reate index ix_comment_product_1 on comment (product_id);\n\n\n\nalter table bill_bill_line add constraint fk_bill_bill_line_bill_01 foreign key (bill_id) references bill (id) on delete restrict on update restrict;\n\nalter table bill_bill_line add constraint fk_bill_bill_line_bill_line_02 foreign key (bill_line_id) references bill_line (id) on delete restrict on update restrict;', 'SET FOREIGN_KEY_CHECKS=0;\n\ndrop table bill;\n\ndrop table bill_bill_line;\n\ndrop table bill_line;\n\ndrop table comment;\n\ndrop table product;\n\ndrop table user;\n\nSET FOREIGN_KEY_CHECKS=1;', 'applied', '');

